description:
Buy here: Pan-Pot.fanlink.to/voodoo-signs

Digital release: 25th June 2021
Vinyl release: September 2021

A1: Voodoo
B1: Signs

@pan-pot return to their Second State imprint to serve up the label's sixth release this year. The illustrious Second State has been fostering the sound of some of techno’s biggest tastemakers and emerging artists for several years, with releases throughout 2021 so far being some of their strongest ones to date. "Voodoo Signs" EP however, is a shift from their usual productions, incorporating a breakbeat sound throughout the record, a step away from the duo’s familiar straight ahead techno weapons.

Hugely atmospheric and packed with conflicting elements, “Voodoo” is the punchier cut of the two tracks on the record. A palpitating muffled kick launches and is quickly joined by rapid percussion and dancing hi-hats that weave throughout the heaviness. As things develop, these turbulent elements are smoothly subdued to let doomy wails echo and build to a crescendo. The main vocal sample meshes with several other voices that ominously quaver over the original. A stabbing melody is then introduced, skittering over the foundations with broken beat drum hooks moving in unison.

On the flip side is “Signs”, a peak time fast paced club track with a driving beat. A stifled kickdrum and a singular bleating tone start things off, before the full weight of the drum is unleashed. A dark looming bass builds on top of cracking percussion and claps until it’s replaced by a distorted male vocal sample crying out “searching, searching”. In the second half, the bleating tone is pushed into the minor key and the bass looms, menacingly. The kick drum returns while the vocal sample becomes increasingly distorted until it fades out. A breakbeat cuts through the noise, switching up the energy and reinstating the hectic, club atmosphere.

@pan-pot
@secondstateaudio

BUY: fanlink.to/pp-confronted-rmx

Digital: 22nd November 2019
Vinyl: 6th December 2019

1: Pan-Pot - Confronted (Pan-Pot Basement Remix)
2: Pan-Pot - Confronted (Frazi.er Raw Remix)
3: Pan-Pot - Confronted (Farrago Welcome To Goa Remix)
4: Pan-Pot - Confronted (Pan-Pot Up In The Air Remix)
5: Pan-Pot - Confronted ([ Wex 10 ] Bigroom Remix)
6: Pan-Pot - Confronted (Anfisa Letyago Stranger Remix)
7: Pan-Pot - Confronted (Pan-Pot Paradise Remix)

Ten years ago, Berlin’s Pan-Pot put out the Confronted EP on Mobilee, a landmark release centred around the title track, eleven and a half minutes of slow-burning techno. A decade later, the Second State dons have decided to celebrate their classic track with a reissue that reflects their evolution. Featuring three remixes from Pan-Pot themselves, Tassilo Ippenberger and Thomas Benedix have also recruited four of the scene’s hottest talents for a diverse, comprehensive remix package that reimagines the source material for today’s dancefloors.

Opening up the remix package, the “Basement” remix by Pan-Pot adds barking synths and snatches of vocal FX in a murky, offbeat edit of the classic. Glaswegian rising star Frazi.er delivers a “Raw”, lean techno tool with subtle tweaks like the crystalline synths piping through the mix and aggressive, springy bass that charges in mid-way through. Farrago, a Lenske favourite from Belgium, takes the listener on a weirder journey built around bounces, bleeps and discombobulation – it’s by far the most foreign departure on the EP and it lives up to the “Welcome to Goa” title.

The “Up In The Air” remix by Pan-Pot removes the pounding kick and turns the mood tribal with steel drums and rubbery, muted basslines. It’s a housier cut well suited to wonky wigouts. French newcomer [ Wex 10 ] takes care of the “Bigroom” remix, ushered in by an outsized, unapologetic kick soon joined by the original’s ominous chords and the cool, detached female vocal. [ Wex 10 ] picks up the BPM, adds some snare rolls and turns in a fist-pumping version for festivals and superclubs. Up-and-comer Anfisa Letyago, from Naples by way of Siberia, sends a rippling acid synth through the mix like lightning in a hi-NRG alternative perfect for trancier sets in her “Stranger” remix. The word “crazy” is set on an electrifying loop, commanding ravers to give in and let go.

Closing the remix EP, the “Paradise” remix by Pan-Pot goes in the opposite direction, opening with bird calls and idyllic chiming synths before moving into breaksy territory. Surprising and strangely dreamy, it completes a richly varied remix package that breathes new life into a beloved classic.

